window.bookSummaryJSON = "<p><i>What Doesn't Destroy Us</i>: When Dani shows up with her provocative temper and innocent charm, Shadow begins to question his violent lifestyle. But can he trust her with his demons?</p> <p><i>The Scars That Define Us</i>: Not knowing who he can trust or who he can forgive has left Shadow feeling alone. As he is lying behind his rifle, he wonders if he can pull the trigger to eliminate the threat.</p> <p><i>The Fear That Divides Us</i>: Jessica is the only female who has Bobby distracted in his game. He's seen the marks on her body, ones that tell the horrors she's lived through. Can he help Jessica, or will it mean giving up his carefree life?</p> <p><i>The Lies Between Us</i>: Lip will do anything for the club without question, including serving six years in prison. But nobody could have predicted life's plan. Rugged and tattooed, Lip is no longer the man whom Cherry remembers. After his release, he came out a beast with more secrets and lies than his cage could hold.</p> <p><i>What Might Kill Us</i>: Bull's unsure of the direction of his life, when the answer - consisting of a terrified Mexican girl - nearly knocks him off his feet. He sees Anahi, and he wants her. But she may come with more baggage than he is ready for.</p> <p>Contains mature themes.</p>"; 
